import React, {Component} from 'react';
import Product from './Product/Product';

class Shop extends Component {
    constructor(){
        super();
        this.state = {
            giftCard: {
                id: 1,
                title: 'gift card',
                price: null,
                name: '',
                address: '',
                email: ''
            }
        }
    }

    render(){
        return(
            <div id='shop'>
                <Product card={this.state.giftCard}/>
            </div>

        )
    }
}

export default Shop;
